import React from "react";
import { FaCheckCircle ,FaUserCircle} from "react-icons/fa";
import { MdOutlineAccountBalanceWallet } from "react-icons/md";
// import { Button } from "@/components/ui/button";
// import { Card, CardContent } from "@/components/ui/card";
import Button from "../components/ui/button";
import { Card, CardContent } from "../components/ui/card";



const Dashboard = () => {
  return (
    <div className="w-3/4 ml-5 text-white">
      <h2 className="text-lg font-semibold mb-3">Get Started</h2>
      <div className="space-y-4">
        <Card className="bg-gray-800 text-white p-4">
          <CardContent className="flex items-center justify-between">
            <p>Your Verification is Completed</p>
            <FaCheckCircle className="text-green-500" size={24} />
          </CardContent>
        </Card>

        <Card className="bg-gray-800 text-white p-4">
          <CardContent className="flex items-center justify-between">
            <div>
              <p>Complete a Deposit to Start Your Trading Journey on Binance</p>
              <FaUserCircle size={40} className="text-yellow-400" />
              <Button className="bg-yellow-400 text-black mt-2">Deposit</Button>
            </div>
            <MdOutlineAccountBalanceWallet size={40} className="text-yellow-400" />
          </CardContent>
        </Card>

        <Card className="bg-gray-800 text-white p-4">
          <CardContent>
            <p>Trade</p>
            <p className="text-gray-400">Pending</p>
          </CardContent>
        </Card>
      </div>
    </div>
  );
};

export default Dashboard;
